sympy.sympy.core.decorators.__sympifyit_:
@wraps(func)
def __sympifyit_wrapper(a, b):
    try:
        # If an external class has _op_priority, it knows how to deal
        # with SymPy objects. Otherwise, it must be converted.
        if not hasattr(b, '_op_priority'):
            b = sympify(b, strict=True)
        return func(a, b)
    except SympifyError:
        return retval

sympy.sympy.core.numbers.__eq__:
def __eq__(self, other):
    if isinstance(other, int):
        return (self.p == other)
    elif isinstance(other, Integer):
        return (self.p == other.p)
    return Rational.__eq__(self, other)

sympy.sympy.external.pythonmpq.__eq__:
def __eq__(self, other):
    """Compare equal with PythonMPQ, int, float, Decimal or Fraction"""
    if isinstance(other, PythonMPQ):
        return (self.numerator == other.numerator
            and self.denominator == other.denominator)
    elif isinstance(other, self._compatible_types):
        return self.__eq__(PythonMPQ(other))
    else:
        return NotImplemented

sympy.sympy.matrices.repmatrix.__eq__:
def __eq__(self, other):
    # Skip sympify for mutable matrices...
    if not isinstance(other, RepMatrix):
        try:
            other = _sympify(other)
        except SympifyError:
            return NotImplemented
        if not isinstance(other, RepMatrix):
            return NotImplemented

    return self._rep.unify_eq(other._rep)

